Excel 2010- Simply.

If you are serious about getting up to speed with Excel 2010, this clear, concise guide is the ideal companion for fast and efficient learning. The author illustrates the main functions of Excel 2010, explaining everything you need to know in plain, jargon-free English with full-colour screen shots and numbered, step-by-step instructions.

Chapters
Working With Excel
Entering And Editing Excel Data
Working With Excel Ranges
Formatting Excel Ranges
Building Formulas And Functions
Manipulating Excel Worksheets
Dealing With Excel Workbooks
Analysing Excel Data
Visualising Data With Excel Charts
Collaborating With Other People

